import * as React from 'react';
import { Text, View } from 'react-native';

function Profile() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Settings!</Text>
      </View>
    );
  }


export default Profile;
